Species in focus: Pristimantis achatinus
Common name: Cachabi Robber Frog

Also known as the Pastures rainfrog, this species of frog is native to northwestern South America, often occurring in forested habitats both montane and tropical. While they are mostly terrestrial, robber frogs will occasionally climb trees to evade predators and have added security in the rainforest while moving about in the night.

